/*Table structure for table `Movie` */

DROP TABLE IF EXISTS `Movie`;

CREATE TABLE `Movie` (
  `Id` varchar(64) NOT NULL,
  `Name` varchar(100) NOT NULL,
  `NameEn` varchar(100) DEFAULT NULL,
  `MovieReview` longtext NOT NULL,
  `MovieReviewEn` longtext,
  `PosterAddress` varchar(300) DEFAULT NULL,
  `CoverAddress` varchar(100) DEFAULT NULL,
  `LastUpdateTime` datetime NOT NULL,
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `Movie` */

insert  into `Movie`(`Id`,`Name`,`NameEn`,`MovieReview`,`MovieReviewEn`,`PosterAddress`,`CoverAddress`,`LastUpdateTime`) values ('05dc16e7-2fb2-4b46-90a2-251e097c78d6','京城81号','The House That Never Dies','导演： 叶伟民<br />\r\n主演： 吴镇宇 林心如<br />\r\n类型： 剧情 惊悚<br />\r\n地区： 内地<br />\r\n&nbsp;风华绝代的青楼头牌，一掷千金的豪门公子。两情相悦不料家人责难，一场闹剧让全族毁于一旦。百年之后的老宅阴森惨淡，前世留下的冤孽今生偿还。<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />','Director：Raymond Yip<br />\r\nStarring：Francis NgRuby Lin<br />\r\nCountry： China<br />\r\n&nbsp; &nbsp;&nbsp;The story is based on that of a purportedly haunted mansion,Chaonei No.81,which is located on No.81 Chaoyangmen Inne Street in Beijing,China.<br />','393','392','2015-05-04 20:19:01'),('2332b5c8-e10e-474c-ac93-1282272e5df7','胶片里的罪恶',' Reel Evil','导演：丹尼.达尔文<br />\r\n主演：杰西卡.莫里斯<br />\r\n类型：恐怖<br />\r\n地区：美国<br />\r\n&nbsp; &nbsp;三个好朋友一直都希望可以自己拍电影，一次偶然的机会可以让他们实现自己的梦想，可是意想不到的事情发生了。<br />\r\n<br />','Director：Danny Draven<br />\r\nStarring：Jessica Morris<br />\r\nCountry：United States<br />\r\n&nbsp; &nbsp;&nbsp;That  is  the  real  horror  film.<br />','395','394','2015-05-04 20:21:23'),('2a517fb0a20243dabea45ecbe628e730','行悦风云录','The Story Of Yeah','行悦风云录简介','The Story Of Yeah Review','389','388','2015-04-18 14:53:51'),('3165fa0d-5bea-4f2d-ac23-d124624cfd8c','庞贝末日','POMPEII','导演：保罗.安德森<br />\r\n主演：基特.哈灵顿 &nbsp;艾米莉.布朗宁<br />\r\n类型：动作<br />\r\n地区：美国 德国<br />\r\n&nbsp; &nbsp;一个叫做迈洛的船王奴隶爱上了船王的女儿，梦想着有一天能够赎回自由身迎娶心上人。然而迈洛没有料到，就在他被卖给那不勒斯另一名奴隶主的同时，他的心上人也被许配给一个腐败的罗马议员。<br />','Director：Paul W.S. Anderson<br />\r\nStarring：Kit Harington  Emily Browning<br />\r\nCountry：Germany  Canada<br />\r\n&nbsp; &nbsp;&nbsp;In Britannia,62 AD,a tribe of Celtic horsemen are brutally wiped out by Romans led by Corvus.The only survivor is a boy named Milo,whose mother Corvus killed personally.<br />','389','388','2015-05-04 20:15:33'),('39eaec98-f56b-49ac-94be-a34abd335948','机器人与弗兰克',' Robot and Frank','导演：杰克.施莱尔<br />\r\n主演：詹姆斯.麦斯登<br />\r\n类型：科幻<br />\r\n地区：美国<br />\r\n&nbsp; &nbsp;影片发生在不久的将来，一位老人的儿子为他提供了一个机器人来照料他的日常生活，老人和机器人之间由此产生了很多故事。<br />','Director：Jake Schreier<br />\r\nStarring：James Marsden<br />\r\nCountry：United States<br />\r\n&nbsp; &nbsp;&nbsp;Set in the near future,it focuses on Frank Weld,an aging jewel thief played by Frank Langella,whose son buys him a domestic robot.<br />','387','386','2015-05-04 20:13:17'),('4c531229-76ca-4460-b4f9-524936d95b4c','太空一号','Lockout','导演： 詹姆斯.马瑟<br />\r\n主演： 盖.皮尔斯 玛姬.格蕾斯<br />\r\n类型： 科幻 剧情<br />\r\n地区： 欧美<br />\r\n&nbsp; &nbsp;未来世界，美国开发出名为“太空一号”的空间站，专门关押罪大恶极的囚徒。某日，现任美国总统的女儿为考察而登上太空一号，谁知意外发生，总统女儿被犯人劫持，一个前特工被派往那里实施营救行动，以少敌多的对决在外太空展开。<br />\r\n<br />','Director：James Mather<br />\r\nStarring：Guy Pearce  Maggie Grace<br />\r\nCountry：France<br />\r\n&nbsp; &nbsp;&nbsp;In 2079,CIA agent Snow is arrested for murdering undercover agent Frank Armstrong,who had uncovered evidence of another agent selling secrets about the space program.<br />','384','383','2015-05-04 20:11:20'),('55dacc37-2d71-4b17-a669-c86a22f85678','白发魔女传之明月天国','The White Haired Witch of Lunar Kingdom','导演： 张之亮 &nbsp;<br />\r\n主演： 范冰冰 黄晓明<br />\r\n类型： 爱情 剧情<br />\r\n地区： 内地&nbsp;<br />\r\n&nbsp; &nbsp;因情所困，为爱白头。正派掌门，魔教妖女。正邪两立的他们却坠入情网。江湖恩怨，国家大难。仗剑天涯的他们终劳燕分飞。<br />\r\n<br />\r\n<br />','Directed by:&nbsp;&nbsp;Jacob Cheung &nbsp;<br />\r\nStarring:&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;Fan Bingbing Huang Xiaoming<br />\r\nCountry:&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;China<br />\r\n&nbsp; &nbsp;The White Haired Witch of Lunar Kingdom is a Chinese wuxia-fantasy film loosely adapted from Liang Yusheng\'s novel Baifa Monu Zhuan.\r\n<br />\r\n<br />\r\n<br />','371','370','2015-05-04 19:22:59'),('9739e38d-2f01-4d29-b3d3-4336c24220d6','赤警威龙',' Bullet to the Head','导演：沃尔特.希尔<br />\r\n主演：西尔维斯特.史泰龙<br />\r\n类型：动作<br />\r\n地区：美国<br />\r\n&nbsp; &nbsp;吉米·波博是一名混迹黑道、刀头舔血的杀手，他奉行不杀女人和儿童的原则，和合作长达六年的搭档路易斯·布兰查登将一个个渣滓送往地狱。<br />','Director：Walter Hill<br />\r\nStarring：Sylvester Stallone<br />\r\nCountry：United States<br />\r\n&nbsp; &nbsp;&nbsp;The screenplay by Alessandro Camon was based on the French graphic novel Du Plomb Dans La Tete written by Matz and illustrated by Colin Wilson.<br />','380','379','2015-05-04 20:06:40'),('db361c1d-2ebf-4931-a08f-b6156e72ccfd','分手大师','The Breakup Guru','导演： 俞白眉 邓超<br />\r\n主演： 邓超 杨幂<br />\r\n类型： 爱情 剧情 喜剧<br />\r\n地区： 内地<br />\r\n&nbsp;  萌贱无敌，见招拆招。梅远贵凭借自己多年的失恋经验成立了帮助他人分手的专业团队。只要给钱，就能完成任务。不料，在甩掉美女叶小春的过程中，两人之间却擦出了爱的火花。<br />','Director：Deng Chao Yu Baimei<br />\r\nStarring：Deng Chao Yang Mi<br />\r\nCountry：China<br />\r\n&nbsp; &nbsp;&nbsp;The Breakup Guru is a 2014 Chinese romantic-comedy-drama film directed by Deng Chao and Yu Baimei and also starring Deng Chao and Yang Mi.<br />','378','377','2015-05-04 20:02:37'),('f0511522-966a-46b9-ac0d-e19a8f0e0f69','宿主',' The Host','导演：安德鲁.尼科尔<br />\r\n主演：西尔莎.罗南 麦克斯.艾恩斯<br />\r\n类型：科幻<br />\r\n地区：美国<br />\r\n&nbsp; &nbsp;影片故事设定在不远的将来，地球被一种名为“灵魂”的外星生物入侵。这种生物通过在人类的神经系统中寄生的方式，来达到逐渐抹灭人类的天性，控制并取代人类的心智，藉由人类的躯体生活在地球。<br />','Director：Andrew Niccol<br />\r\nStarring：Saoirse Ronan  Max Irons<br />\r\nCountry：United States<br />\r\n&nbsp; &nbsp;The human race has been taken over by small parasitic aliens called \"Souls\".<br />','376','375','2015-05-04 19:54:01'),('f97d0cc6-61a9-4273-b605-fef414b3d7d3','暴力街区','Brick Mansions','导演： 卡米尔.狄拉玛<br />\r\n主演： 保罗.沃克 大卫.贝利<br />\r\n类型： 动作 剧情<br />\r\n&nbsp; &nbsp;卧底探员达米安生活在弱肉强食的“红砖特区”内。而希望离开禁区重过新生活的利诺，因为女友罗拉被特里梅因掳走而心急如焚。拥有共同敌人，来自不同世界，背景各异的达米安与利诺决定联手对敌。<br />\r\n<br />\r\n<br />\r\n<br />','Directed by： Camille Delamarre<br />\r\nStarring：&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Paul Walker   &nbsp;David Belle<br />\r\nCountry：&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;France    &nbsp;Canada<br />\r\n&nbsp; &nbsp;In 2018,in a dystopian Detroit,abandoned brick mansions left from better times now house only the most dangerous criminals.<br />\r\n<br />\r\n<br />\r\n<br />','373','372','2015-05-04 19:44:53');

/*Table structure for table `MovieTemplate` */

